import Header from "../components/Header";

const Analytics = () => {
  return (
    <div>
      <Header />
      <div className="analytics-container">
        <div className="card-1">
          <p>Card 1</p>
        </div>
        <div className="card-2">
          <p>Card 2</p>
        </div>
        <div className="card-3">
          <p>Card 3</p>
        </div>
        <div className="card-4">
          <p>Card 4</p>
        </div>
      </div>
    </div>
  );
};

export default Analytics;
